                        <html><head><meta charset="utf-8"></head><body>
<p>Линолевая кислота и витамины группы В обеспечивают хороший вид, блеск шерсти и поддерживают здоровье кожи. Оптимальная энергетическая ценность корма позволяет удерживать необходимую массу тела и предохраняет от ожирения. Оптимальное содержание клетчатки способствует правильной работе желудочно-кишечного тракта и наилучшему усвоению питательных веществ.</p>
<h5>Условия и срок хранения:</h5>
<p>Корма хранить в сухих, чистых, проветриваемых помещениях, защищенных от прямых солнечных лучей, при температуре от минус 20&ordm;С до +35&ordm;С и относительной влажности воздуха не более 85%. Не допускается хранение кормов в одном помещении с ядохимикатами и другими вредными веществами, а также продуктами, обладающими сильным специфическим запахом. <br />Срок хранения/срок годности: 18 месяцев с даты изготовления. Дата изготовления указана на упаковке.</p>
</body></html>

